import React from "react";
import ReactDOM from "react-dom";
import Card from "./card";
import contacts from "../contacts";

function name(params) {

}

function App(params) {
  return <div>
    <Card name={contacts[0].name} imgurl={contacts[0].imgURL} phone={contacts[0].phone} email = {contacts[0].email} />
    <Card name={contacts[1].name} imgurl={contacts[1].imgURL} phone={contacts[0].phone} email = {contacts[1].email} />
    <Card name={contacts[2].name} imgurl={contacts[2].imgURL} phone={contacts[0].phone} email = {contacts[2].email} />
  </div>
}

export default App;
